/**
 * @access private
 * @param {String}
 * @returns {Boolean|null} true if uppercase, false if lowercase, null if neither
 */
export function getStringCase(string: any): boolean | null;
/**
 * @access private
 * @param {Array<Object>} parts
 * @return {String|undefined}
 */
export function formatNameParts(parts: Array<any>): string | undefined;
/**
 * @access private
 * @param {Array<Object>} parts
 * @param {Boolean} [orderGiven=true] - also consider the given name
 * @return {Array<String>}
 */
export function orderNameParts(parts: Array<any>, orderGiven?: boolean): Array<string>;
/**
 * @access private
 * @param {Array<Array<Object>>} pieces
 * @return {Object}
 */
export function orderNamePieces(pieces: Array<Array<any>>): any;
